css:
.editor {
  background-color: #000000;
  color: #ededed;
}
.editor .gutter {
  background-color: #000000;
  color: #ededed;
}
.editor .gutter .line-number.cursor-line {
  background-color: rgba(255, 255, 255, 0.1);
  color: #ededed;
}
.editor .gutter .line-number.cursor-line-no-selection {
  color: #ededed;
}
.editor .wrap-guide {
  color: #535353;
}
.editor .indent-guide {
  color: #535353;
}
.editor .invisible-character {
  color: #2e2e2e;
}
.editor .search-results .marker .region {
  background-color: transparent;
  border: #535353;
}
.editor .search-results .marker.current-result .region {
  border: #ededed;
}
.editor.is-focused .cursor {
  border-color: #ffffff;
}
.editor.is-focused .selection .region {
  background-color: #333333;
}
.editor.is-focused .line-number.cursor-line-no-selection,
.editor.is-focused .line.cursor-line {
  background-color: rgba(255, 255, 255, 0.1);
}
.comment {
  color: #444444;
}
.entity {
  color: #F67B37;
}
.keyword {
  color: #96CBFE;
}
.keyword.control {
  color: #96CBFE;
}
.keyword.operator {
  color: #EDEDED;
}
.entity.name.type {
  color: #FFFFB6;
}
.support {
  color: #FFFFB6;
}
.storage {
  color: #CFCB90;
}
.storage.modifier {
  color: #96CBFE;
}
.constant {
  color: #99CC99;
}
.string {
  color: #98E659;
}
.constant.numeric {
  font-weight: bold;
  color: #FF73FD;
}
.variable {
  color: #C6C5FE;
}
.invalid.deprecated {
  font-style: italic;
  text-decoration: underline;
  color: #FD5FF1;
}
.invalid.illegal {
  color: #FD5FF1;
  background-color: rgba(86, 45, 86, 0.75);
}
.text .source {
  background-color: rgba(177, 179, 186, 0.03);
}
.entity.other.inherited-class {
  color: #9B5C2E;
}
.source .string .source {
  color: #EDEDED;
}
.source .string .source .punctuation.section.embedded {
  color: #00A0A0;
}
.string .constant {
  color: #00A0A0;
}
.string.regexp {
  color: #E9C062;
}
.string.regexp .constant.character.escape,
.string.regexp .source.ruby.embedded,
.string.regexp .string.regexp.arbitrary-repitition {
  color: #FF8000;
}
.string.regexp.group {
  color: #C6A24F;
  background-color: rgba(255, 255, 255, 0.06);
}
.string.regexp.character-class {
  color: #B18A3D;
}
.string .variable {
  color: #8A9A95;
}
.support.function {
  color: #F67B37;
}
.support.constant {
  color: #FFD2A7;
}
.meta.preprocessor.c {
  color: #8996A8;
}
.meta.preprocessor.c .keyword {
  color: #AFC4DB;
}
.meta.cast {
  font-style: italic;
  color: #676767;
}
.meta.sgml.html .meta.doctype,
.meta.sgml.html .meta.doctype .entity,
.meta.sgml.html .meta.doctype .string,
.meta.xml-processing,
.meta.xml-processing .entity,
.meta.xml-processing .string {
  color: #494949;
}
.meta.tag,
.meta.tag .entity {
  color: #96CBFE;
}
.source .entity.name.tag,
.source .entity.other.attribute-name,
.meta.tag.inline,
.meta.tag.inline .entity {
  color: #96CBFE;
}
.entity.other.attribute-name {
  color: #FFD7B1;
}
.entity.name.tag.namespace,
.entity.other.attribute-name.namespace {
  color: #E18964;
}
.meta.selector.css .entity.name.tag {
  color: #96CBFE;
}
.entity.other.attribute-name.pseudo-element.css,
.entity.other.attribute-name.pseudo-class.css {
  color: #8F9D6A;
}
.meta.selector.css .entity.other.attribute-name.id {
  color: #8B98AB;
}
.meta.selector.css .entity.other.attribute-name.class {
  color: #62B1FE;
}
.support.type.property-name.css {
  color: #BBBBBB;
}
.meta.property-group .support.constant.property-value.css,
.meta.property-value .support.constant.property-value.css {
  color: #F9EE98;
}
.meta.preprocessor.at-rule .keyword.control.at-rule {
  color: #8693A5;
}
.meta.property-value .support.constant.named-color.css,
.meta.property-value .constant {
  color: #87C38A;
}
.meta.constructor.argument.css {
  color: #8F9D6A;
}
.meta.diff,
.meta.diff.header {
  font-style: italic;
  color: #F8F8F8;
  background-color: #0E2231;
}
.markup.deleted {
  color: #F8F8F8;
  background-color: #420E09;
}
.markup.changed {
  color: #F8F8F8;
  background-color: #4A410D;
}
.markup.inserted {
  color: #F8F8F8;
  background-color: #253B22;
}
.markup.italic {
  font-style: italic;
  color: #E9C062;
}
.markup.bold {
  font-weight: bold;
  color: #E9C062;
}
.markup.underline {
  text-decoration: underline;
  color: #E18964;
}
.markup.quote {
  font-style: italic;
  color: #E1D4B9;
  background-color: rgba(254, 224, 156, 0.07);
}
.markup.heading,
.markup.heading .entity {
  color: #FEDCC5;
  background-color: #632D04;
}
.markup.list {
  color: #E1D4B9;
}
.markup.raw {
  color: #578BB3;
  background-color: rgba(177, 179, 186, 0.03);
}
.markup .comment {
  font-style: italic;
  color: #F67B37;
}
.meta.separator {
  color: #60A633;
  background-color: #242424;
}
.meta.line.entry.logfile,
.meta.line.exit.logfile {
  background-color: rgba(238, 238, 238, 0.16);
}
.meta.line.error.logfile {
  background-color: #751012;
}
